import React from 'react';
import TypeBar from '../components/TypeBar';
import BrandBar from '../components/BrandBar';

const Shop = () => {
    return (
        <div className='d-flex justify-content-center pt-5 pb-5'>
            <div className=' d-flex align-items- row gy-5'>
                <TypeBar/>
                <BrandBar/>
            </div>
            <div style={{width: '60%'}}>
                
            </div>
        </div>
    );
};

export default Shop;
